// preloader

window.onload = function () {
    $(".phone-menu").hide();
    document.body.classList.add('loaded_hiding');
    window.setTimeout(function () {
      document.body.classList.add('loaded');
      document.body.classList.remove('loaded_hiding');
    }, 500);
}

$(document).ready(function(){
    $(".-js-menu-clicked").click(function(){
        $(".phone-menu").fadeToggle();
    });
  });


// seeding

function seedFilms(elementouter)
{
    films.forEach(element => {
        $(elementouter).append(
            `<div style="position: relative; margin-top: 20px;">
                <div class="item-img-outer">
                    <img src="${element.poster}" />
                </div>

                <div class="item-raiting ${getRaitingTheme(element.imdbRaiting)}">
                    <p>${element.imdbRaiting}</p>
                </div>

                <div class="naming-texting-item">
                    <p class="item-main-text">${element.name}</p>
                    <p class="item-mini-text">${element.createDate}, ${element.genreMain}</p>
                </div>
            </div>`
        ); 
    });
}

function seedTopFilms(elementouter)
{
    var s = 0;
    films.sort(( a, b ) => b.imdbRaiting - a.imdbRaiting).forEach(element => {
        s++;
        $(elementouter).append(
            `
            <div style="display: flex; gap: 15px;">
            <p class="numeric-item">${s}</p>    
                <div style="position: relative;">
                    <div class="item-img-outer">
                        <img src="${element.poster}" />
                    </div>

                    <div class="item-raiting ${getRaitingTheme(element.imdbRaiting)}">
                        <p>${element.imdbRaiting}</p>
                    </div>
                </div>

                <div class="naming-texting-item">
                    <p class="item-main-text-row">${element.name}</p>
                    <p class="item-meduim-text">${element.engName}, ${element.createDate}</p>
                    <p class="item-mini-text">${element.country} • ${element.genre}</p>
                    <p class="film-info">${element.review}</p>
                </div>
            </div>`
        ); 
    });
}

